class Slide {
    constructor(src, description) {
        this._src = src;
        this._description = description;
    }
    get src(){
        return this._src;
    }
    get description(){
        return this._description;
    }
    set src(newValue){
        this._src = newValue;
    }
    set description(newValue){
        this._description = newValue;
    }
}

class Carousel {
    constructor(slides, currentIndex = 0) {
        this._slides = slides;
        this._currentIdex = currentIndex;
    }
    get currentIndex(){
        return this._currentIdex;
    }
    set currentIndex(value) {
        if (typeof value !== 'number') throw new TypeError('Not a number');
        if (!Number.isSafeInteger(value) || value < 0 || value >= this._slides.length) throw new RangeError('Value is not in range');
            this._currentIdex = value;
    }
    get currentSlide(){
        return this._slides[this.currentIndex];
    }
    get nextSlide(){
        return this._slides[this.nextIndex];
    }
    get prevSlide(){
        return this._slides[this.prevIndex];
    }
    get nextIndex(){
        return (this._currentIdex +1) % this._slides.length;
    }
    get prevIndex(){
        return (this._currentIdex -1 + this._slides.length) % this._slides.length;
    }
}

const carousel = new Carousel(
    [
        new Slide(
            'data:image/jpeg;base64,',
            'Van gog'),
        new Slide(
            'data:image/jpeg;base64,',
            'Van gog'),
        new Slide(
            'data:image/jpeg;base64,',
            'Van gog'),
        new Slide(
            'data:image/jpeg;base64,',
            'Van gog'),
        new Slide(
            'data:image/jpeg;base64,',
            'Van gog')
    ]);

const [prevButtonElem, nextButtonElem] = document.querySelectorAll('.btn');

const sliderClick = (direction = 'next') => (e) => {
    carousel.currentIndex =
        carousel[direction === 'next' ? 'nextIndex' : 'prevIndex'];
    updateSlide(direction);
};

prevButtonElem.addEventListener('click', sliderClick('prev'));
nextButtonElem.addEventListener('click', sliderClick('next'));

updateSlide();

function updateSlide(direction) {
    const oldCurrentImg = document.querySelector('.currentImage');
    const newCurrentImg = document.querySelector('.nextImage');
    const currentSlide = carousel.currentSlide;
    //const nextSlide = carousel[direction == 'next' ? 'nextSlide' : 'prevSlide'];
    newCurrentImg.classList.replace('nextImage', 'currentImage');
    oldCurrentImg.classList.replace('currentImage', 'nextImage');
    newCurrentImg.setAttribute('src', currentSlide.src);
    //console.log('new event');
}

